             <p className = 'mt-2'>資料總筆數:{dataQuantity} 最新資料日期: {newestDate} 資料總表下載: <a href = 'http://140.116.214.154:3000/api/data/download/line' download = {"post_board_memo.csv"}>點此</a></p>
             </form>
        </>
    );
}

export default SearchBlockComp;
